import React from 'react'

const Nav = ({search, setSearch}) => {
  return (
    <nav className='nav'>
      <form className='searchForm' 
        onSubmit={ e => e.preventDefault() }
      >
        <input 
          type="text" 
          id="search"
          role='search'
          placeholder='search post'
        />
      </form>
    </nav>
  )
}

export default Nav;
